// Projects.js
import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import { ProjectCard } from './ProjectCard';
import projImg1 from '../assets/img/project-img1.png';
import projImg2 from '../assets/img/project-img2.png';
import projImg3 from '../assets/img/project-img3.png';
import colorSharp2 from '../assets/img/color-sharp2.png';
import 'animate.css';
import TrackVisibility from 'react-on-screen';

export const Projects = () => {
  const projects = [
    {
      title: 'Business Startup 1',
      description: 'Design & Development',
      imgUrl: projImg1,
      Link: 'https://bibado.lt/',
    },
    {
      title: 'Business Startup 2',
      description: 'Design & Development',
      imgUrl: projImg2,
      link: 'https://your-link-for-project2.com/',
    },
    {
      title: 'Business Startup 3',
      description: 'Design & Development',
      imgUrl: projImg1,
      link: 'https://your-link-for-project3.com/',
    },
    {
      title: 'Business Startup 4',
      description: 'Design & Development',
      imgUrl: projImg1,
      link: 'https://your-link-for-project4.com/',
    },
    {
      title: 'Business Startup 5',
      description: 'Design & Development',
      imgUrl: projImg2,
      link: 'https://your-link-for-project5.com/',
    },
    {
      title: 'Business Startup 6',
      description: 'Design & Development',
      imgUrl: projImg3,
      link: 'https://your-link-for-project6.com/',
    },
  ];

  return (
    <section className="project" id="projects">
      <Container>
        <Row>
          <Col size={12}>
            <TrackVisibility>
              {({ isVisible }) => (
                <div className={isVisible ? 'animate__animated animate__fadeIn' : ''}>
                  <h2>
                    <a href="https://your-business-startup-link.com" target="_blank" rel="noopener noreferrer">
                      Projects
                    </a>
                  </h2>
                  <p>
                    Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been
                    the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of
                    type and scrambled it to make a type specimen book.
                  </p>
                  <Row>
                    {projects.map((project, index) => (
                      <ProjectCard key={index} {...project} />
                    ))}
                  </Row>
                </div>
              )}
            </TrackVisibility>
          </Col>
        </Row>
      </Container>
      <img className="background-image-right" src={colorSharp2} alt="Background" />
    </section>
  );
};
